import React from 'react';

const Contact = ({  }) => {
  const contact = {
    name: "Steven Yoh",
    email: "steven.christopher.yoh@gmail.com",
    location: "Cupertino, CA",
    phone: "408-483-9380"
  }
  return (
    <div>
      <h1>Contact</h1>
      <address>
        {contact.email}<br/>
        {contact.location}<br/>
        {contact.phone}
      </address>
      <a href="https://www.linkedin.com/in/stevenyoh/">
        <button>LinkedIn</button>  
      </a><br/>
      <a href="https://github.com/fu11m3tal">
        <button>Github</button>    
      </a><br/>
    </div>
  )
}

export default Contact;
